import React from 'react';
import './Layout.css';

const Sidebar = () => {
    return (
        <div className="sidebar">
            <div className="image">
                <img src="/office-workplace.svg" alt="User" />
                <span>User</span>
            </div>
            <div><a href="#home">Dashboard</a><span><img src='/dashboard.svg'></img></span></div>
            <div><a href="#services">Expenses</a><span><img src='/expenses.svg'></img></span></div>
            <div><a href="#about">Income</a><span><img src='/income.svg'></img></span></div>
            <div>     <a href="#contact">Transactions</a><span><img src='/transaction.svg'></img></span></div>
            <div>  <a href="#contact">Log Out </a><span><img src='/logout.svg'></img></span></div>

        </div>
    );
};

const Navbar = () => {
    return (
        <div className="navbar">
            <button className="help-button">Help & Support</button>
        </div>
    );
};

const Layout = ({ children }) => {
    return (
        <>
            <Sidebar />
            <div className="content-wrapper">
                <Navbar />
                <div className="main-content">
                    {children}
                </div>
            </div>
        </>
    );
};

export default Layout;
